(2497, 'Snobs In The City ð©', 'snobs_in_the_city', '1387444985222040322_3431031682', 'Meanwhile in Bali ... nothing but me, my pool boy and a G&T ðâï¸ .\n.\n.\nð¸ by  @snobs_in_the_city - @the_seminyak_snob \nWe live in Seminyak but love to travel the world. \nFollow our adventures here, on Facebook and be sure to check us out on line for our travels and tips ;\nwww.theseminyaksnob.com\n\n#seminyak #snob #sunshine  #endlesssummer #beaches #resorts #pools #travelasia #instagood #vacays #paradise #holidays #vacations  #bali #beautiful #tropical #travel #island #islandlife #balivillas #sunsets #explore #travelblogger #islandvibes #surf #baliholidays #seminyaksnob #bikini #cocktails', 'https://www.instagram.com/p/BNBMdzxjosC/', 'https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/15101520_242542272828801_2287173220169678848_n.jpg?ig_cache_key=MTM4NzQ0NDk4NTIyMjA0MDMyMg%3D%3D.2', 'image', '', 0, '2016-11-21 14:10:19', '2016-11-21 14:10:19'),
(2498, 'Jessie Coleman', 'jessieannecoleman', '1387443811252518001_3445131', 'A massive insecurity for me has always been my legs. No matter how much I workout or eat clean, I will never have the long skinny legs that I always thought were the ideal. I will never have a massive box gap, nor will I ever be able to neatly fit my thigh within the circumference of my hands. I will never have the body of a super model like I aspired for in my late teens & early twenties. I\'ve only started to come to a place where I\'m accepting my body for what it truly is over the last couple of weeks if I\'m honest.\nMy legs are strong. My legs can squat for a long time & ride bikes up steep inclines. My legs can carry me through a 10km run. My legs are a gift that I need to learn to be grateful for, not something I need to criticise. As women, we love to analyse & dissect our bodies - "if only I could change this, I\'d be happy," - when the reality is, true happiness comes from accepting who we are, & loving ourselves so much that we nurture our bodies, minds, emotions, & spirits into being the healthiest versions of us that we can be. If your naturally petite, that\'s beautiful. If you\'re naturally curvy, that\'s beautiful. As long as we\'re healthy - mind, body, & spirit - then we are stunning just as we are. ð\n.\n.\n#love #preachingtomyself #beautiful #beauty #mind #body #spirit #beach #bikini #motivation #inspiration #gratitude #sunday #endlesssummer #reflections #selflove #healthy #balance #fit #inspo #blog #motivated #lifestyle #blogger #fitspo #empower #encouragement #wanderlust @cottonon @rockmansfashion', 'https://www.instagram.com/p/BNBMMubhTxx/', 'https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/14515873_209164776200555_5093464684841926656_n.jpg?ig_cache_key=MTM4NzQ0MzgxMTI1MjUxODAwMQ%3D%3D.2', 'image', '', 0, '2016-11-21 14:10:19', '2016-11-21 14:10:19'),
