(1076, 'Corey Baca', 'mxpvmc', '1383457226903205139_225482691', 'Ellie has always had some minor leg issues ever since we rescued her.  Her patella would slip in and out of place as she walked, she would begin to limp even on the shortest walks.  The vet gave a couple options: option 1- put her on a strict diet and hope for the best, and worse case have expensive surgery and option 2-have an expensive surgery, put her on a diet and hope for the best.  We chose option 1, not easy with the pug in her(they eat any and everything). Keeping her at her ideal weight has worked great.  However, after long hikes she still gets fatigued and you notice her leg giving her problems.  We brought a large backpack for this hike, and at around mile 4.5 we slipped her in and she just melted.  She didnât even want to get out at the end of the hike.  Crack Canyon was a little tricky with dogs, but completely doable.\n.\n.\n.\n.\n#puggle #pugglesofinstagram #campingwithdogs #hikingwithdogs #optoutside #rei1440project #myrescuestory #endlesssummer', 'https://www.instagram.com/p/BMzBwSbgzUT/', 'https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/14709453_706313869534210_4813565763560407040_n.jpg?ig_cache_key=MTM4MzQ1NzIyNjkwMzIwNTEzOQ%3D%3D.2', 'image', '', 0, '2016-11-15 23:18:21', '2016-11-15 23:18:21'),
