(1583, 'Gerald Gillum & Devon Baldwin', 'gerald.and.devon', '1388286879090915512_2125561221', 'I just had to share this asap because she\'s too beautiful and I felt like everyone needed to see this lil angel. I\'m honestly so happy every single day that I discovered her music and basically just her as a person, idek how many posts I\'ve made appreciating Dev but it\'s not even close to enough. The amount of love and respect I have for her is so incredible and the fact she takes the time to speak with the fans who send her messages or tweet her or tag her in things, I love that. It makes you feel so much more connected to the artist as well as the music and that\'s really important for me when it comes to music I love, if I don\'t feel a connection with the artist then it\'s just another song to me. Okay I\'ll stop now, but I seriously love Devon with all my heart and soulð\n#devonbaldwin #devonjohanna #devonjbaldwin #devonjohannabaldwin #geazy #geraldgillum #geraldearlgillum #geraldegillum #younggerald #endlesssummer #whenitsdarkout #thesethingshappen #mustbenice #epidemic #mermaids #lungsep #sirensong #endlesssummertour #gevon #g_eazy #eazyseason #christophandersson', 'https://www.instagram.com/p/BNEL4-ijLi4/', 'https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/14515880_1123743494405511_282536675446358016_n.jpg?ig_cache_key=MTM4ODI4Njg3OTA5MDkxNTUxMg%3D%3D.2', 'image', '', 0, '2016-11-21 14:09:43', '2016-11-21 14:09:43'),
