(1652, 'Brittany', 'mermaama', '1388201398084445658_1693409022', 'Do you ever feel like your drowning in all the responsibilities we have created for ourselves? Me too. But as important as it is to take care of all those little and big things it\'s also really important to take care of ourselves, to reconnect with Mother Earth ð and soak up all her glory. There is nothing that recharges me better or more quickly than fully submerging myself in the oceanð¦ and this time of year you can hear the whales ðsinging down here. I love the way the ocean makes me feel, so small, so simple, so delicate, so weightless. It\'s humbling to be such a small fish in such a big ocean and with the way the world is turning right now (yes I\'m talking about you politics) I like the silence and disconnection down here. I promise to raise my girls to believe that they are fully capable of anything with a loving open heart no matter what negative influences are out there. Life is one big ying and yang and it\'s all about balance, it\'s our job as parents raising the next generation to bring forth more love and compassion for a better tomorrow. ð ð¦â¨ #lovesconquersall #havefaith #normalizeveganism', 'https://www.instagram.com/p/BND4dEJhiXa/', 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/14574050_225132057923925_8155581813461352448_n.jpg?ig_cache_key=MTM4ODIwMTM5ODA4NDQ0NTY1OA%3D%3D.2', 'image', '', 0, '2016-11-21 14:09:45', '2016-11-21 14:09:45'),
