(1981, 'Stone Brewing', 'stonebrewingco', '1387918787600479959_36391423', '...still sunny in good ole #SanDiego! ð ð» Cheers to @craftbeerdudes for the photo and thoughtful review of #DeliciousIPA ð» â â â â â â "This was a delicious IPA by Stone, exactly the kind of IPA that you would expect from them. For a beer with a very strong hop backbone, it\'s not overdone. Very enjoyable beer that we will drink again!\n\nAppearance - Pours a beautiful golden orange color with a one finger white head that dissipates over time, leaves lacing\n\nAroma - Immediate strong and delicious  hops, lemon, lemon peel, citrus zest, pine. \nTaste - More pine and resinous hops, following the nose. More lemon zest with citrus and a subtle sweetness that calms the bitterness on the finish. \nMouthfeel - Medium body with medium carbonation. Somewhat crisp finish with lots of resinous hop aftertaste."', 'https://www.instagram.com/p/BNC4MioBHbX/', 'https://scontent.cdninstagram.com/t51.2885-15/e35/p480x480/14488328_1178748435495958_1285796565700575232_n.jpg?ig_cache_key=MTM4NzkxODc4NzYwMDQ3OTk1OQ%3D%3D.2', 'image', '', 0, '2016-11-21 14:09:58', '2016-11-21 14:09:58'),
