(2007, 'Catherine Ryan', 'fixed_lenzuz', '1387903148216515345_2270616166', 'The disappearance of autumn hurts, it hurts like a breakup. Nostalgia hits and all my heart longs for is the warmth of lost memories. I want to blanket myself in summertime road trips, sandy toes, the vibrations of outdoor concerts under the stars. I don\'t want to feel the discomfort of the unknown, the coldness of something new. I\'d just rather not. Not today, and maybe not tomorrow or the next day. Yet, winter approaches a little more each day without my permission. I\'m just being honest, I would\'ve said no. #endlesssummer', 'https://www.instagram.com/p/BNC0o9UF3sR/', 'https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/15046860_1838672899701243_457676151762976768_n.jpg?ig_cache_key=MTM4NzkwMzE0ODIxNjUxNTM0NQ%3D%3D.2', 'image', '', 0, '2016-11-21 14:10:00', '2016-11-21 14:10:00'),
