(3122, 'EVA', 'evi_scnr', '1386882824015877872_2121912378', '"What it is feel like to be present? To be here in the now and fully experiencing this moment. Free from any weight  from the past. Or any anticipation of the future. \nJust free. Free to realize that only you can control how you feel. About anything . Free to give your time and energy to what really matters. \nAccept the fact that everything that makes up your world is there because you attracted it with your own thoughts. Realize that you can control your thought and  emotions. There is no big secret. Just choose the thing better feeling thoughts. Listen to your emotion and  choose to feel good. You can decide to be in a place of attraction or abandons. " -High of Life 3 Years of Travel in 3 Minutes \nhttps://youtu.be/wJF5NXygL4k \n#gilitrawangan #indonesia #asia #giliislands #gilit #swingpicture #swing #fittravel #picoftheday #lile4like #endlesssummer #wanderlust #backpacking #island #travel #reisenfuerweltentdecker #solotraveler #aroundtheworld #travelgram #weltreise #travelphotography', 'https://www.instagram.com/p/BM_MpSWjpbw/', 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/15046991_215268895581431_4886866024781053952_n.jpg?ig_cache_key=MTM4Njg4MjgyNDAxNTg3Nzg3Mg%3D%3D.2', 'image', '', 0, '2016-11-21 14:10:45', '2016-11-21 14:10:45'),
