(3232, 'Allison ðð¿ðð¼', 'yoga.mommy.love', '1386755990208135431_3654511077', 'Day 5 of @katiebhappyy and @theonelovemovement #b_inspired #kindnesschallenge - #gratitude for the present. Beyond this most perfect sunset I saw this evening, I am #grateful for the #kindness I experienced today. I flew from Wisconsin to San Diego with baby boy in tow. Not only did I experience the kindness of strangers offering to help make my travels easier, I witnessed the kindness among the human race. People from all different parts of the country, jammed on a full flight, were helping one another, sharing life stories, listening, caring, laughing, and understanding. How refreshing it was to be relieved of our differences and instead display kindness. I truly believe we all desire the greater good for one another, just have different ideas on how to achieve this.\n.\n.\n.\n.\n. #ibelieveinthegoodthingscoming #kindness #grateful #love #sunset #sandiego #nofilter #endlesssummer #sandiego #pacificbeach #pb #pacificbeachsandiego', 'https://www.instagram.com/p/BM-vznKgEEH/', 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/15046909_601775873365506_552975076559945728_n.jpg?ig_cache_key=MTM4Njc1NTk5MDIwODEzNTQzMQ%3D%3D.2', 'image', '', 0, '2016-11-21 14:10:50', '2016-11-21 14:10:50'),
