(3657, 'Matty', 'malettashredda', '1386381324532665348_234752929', 'When my parents bought their first VCR in the 1980s they brought a rented copy of a film from 1966 entitled The Endless Summer. We were so stoked to see surfing on tv. The film touched lives of millions and was the catalyst for surf and adventure travel not just for surfers but for people in small town USA. Radical to get to hear Robert August who was 18 when the film was made show clips and tell the back story of their historical round the world crossing. In Gansett we called it "The Endless Movie" i trekked all the way to Cape Saint Francis South Africa because of this movie #endlesssummer #hawaii #longboard #robertaugust #hhsurf', 'https://www.instagram.com/p/BM9angkAUwE/', 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/14597411_326806161038804_8474860413706567680_n.jpg?ig_cache_key=MTM4NjM4MTMyNDUzMjY2NTM0OA%3D%3D.2', 'image', '', 0, '2016-11-21 14:11:06', '2016-11-21 14:11:06'),
